import { Navigate } from "react-router";
import "./UserPage.scss";

const UserPage = () => {
  const logoutUser = () => {
    localStorage.removeItem("Token");
    return <Navigate to="/login" />;
  };

  return (
    <button className="logout-button" onClick={logoutUser}>
      Logout
    </button>
  );
};

export default UserPage;
